INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (1, 'ArrayList is not synchronized.Vector is synchronized.ArrayList increases its size by 50% of the array size.Vector increases its size by doubling the array size.', '0', 'What is the difference between ArrayList and Vector?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (2, 'Vector increases its size by doubling the array size.', '0', 'What is the difference between ArrayList and LinkedList?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (3, 'Iterator traverses the elements in forward direction only.ListIterator traverses the elements in backward and forward directions both.Iterator can be used in List, Set and Queue.ListIterator can be used in List only.', '0', 'What is the difference between Iterator and ListIterator?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (4, 'Enumeration can traverse only legacy elements.Iterator is fail-fast.Enumeration is not fail-fast.Iterator is slower than Enumeration.Enumeration is faster than Iterator.', '0', 'What is the difference between Iterator and Enumeration?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (5, 'List can contain duplicate elements whereas Set contains only unique elements.', '0', 'What is the difference between List and Set?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (6, 'HashSet maintains no order whereas TreeSet maintains ascending order.', '0', 'What is the difference between HashSet and TreeSet?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (7, 'Set contains values only whereas Map contains key and values both.', '0', 'What is the difference between Set and Map?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (8, 'HashSet contains only values whereas HashMap contains entry(key,value). HashSet can be iterated but HashMap need to convert into Set to be iterated.', '0', 'What is the difference between HashSet and HashMap?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (9, 'HashMap maintains no order but TreeMap maintains ascending order.', '0', 'What is the difference between HashMap and TreeMap?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (10, 'HashMap is not synchronized.Hashtable is synchronized.HashMap can contain one null key and multiple null values.Hashtable cannot contain any null key or null value', '0', 'What is the difference between HashMap and Hashtable?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (11, 'Collection is an interface whereas Collections is a class. Collection interface provides normal functionality of data structure to List, Set and Queue. But, Collections class is to sort and synchronize collection elements.', '0', 'What is the difference between Collection and Collections?', '0');
INSERT INTO card (card_id, answer, numb_of_users_ratings, question, rating) VALUES (12, 'Comparable provides only one sort of sequence.Comparator provides multiple sort of sequences.It provides one method named compareTo().It is found in java.lang package.it is found in java.util package.If we implement Comparable interface, actual class is modified.Actual class is not modified.', '0', 'What is the difference between Comparable and Comparator?', '0');
